-- Assign 'USER' role to every user
INSERT INTO users_roles (user_id, role_id)
SELECT users.id AS user_id, roles.id AS role_id
FROM users
JOIN roles ON roles.name = 'USER'
WHERE NOT EXISTS (SELECT 1 FROM users_roles
                  WHERE user_id = users.id
                    AND role_id = roles.id);

